import React, { useState } from 'react';

function App() {
  const [isRecording, setIsRecording] = useState(false);
  const [caseID, setCaseID] = useState('');
  const [recordings, setRecordings] = useState([
    { id: 1, date: '2023-02-20', time: '10:00 AM', caseID: 'CASE-001', duration: '30 minutes' },
    { id: 2, date: '2023-02-22', time: '2:00 PM', caseID: 'CASE-002', duration: '1 hour' },
    { id: 3, date: '2023-02-25', time: '4:00 PM', caseID: 'CASE-003', duration: '45 minutes' },
  ]);
  const [selectedRecording, setSelectedRecording] = useState(null);

  const handleRecord = () => {
    setIsRecording(true);
    // Start recording logic here
  };

  const handleStop = () => {
    setIsRecording(false);
    // Stop recording logic here
  };

  const handleCaseIDChange = (event) => {
    setCaseID(event.target.value);
  };

  const handleRecordingSelect = (recording) => {
    setSelectedRecording(recording);
  };

  return (
    <div className="flex h-screen">
      <div className="w-1/4 bg-gray-100 p-4">
        <h1 className="text-xl font-bold mb-4">Application Name</h1>
        <div className="mb-4">
          <h2 className="text-lg font-bold mb-2">OPTIONS</h2>
          <button className="bg-black text-white px-4 py-2 rounded-md" onClick={handleRecord}>
            Record
          </button>
        </div>
        <div className="mb-4">
          <h2 className="text-lg font-bold mb-2">Recordings</h2>
          <div className="relative">
            <button
              className="bg-gray-300 text-gray-700 px-4 py-2 rounded-md w-full"
              onClick={() => {
                // Toggle dropdown visibility
              }}
            >
              Select Recording
              <svg
                className="w-4 h-4 ml-2"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M19 9l-7 7-7-7"
                />
              </svg>
            </button>
            <div
              className="absolute bg-white shadow-md p-4 w-full hidden"
              // Toggle dropdown visibility
            >
              <ul>
                {recordings.map((recording) => (
                  <li key={recording.id}>
                    <button
                      className="block w-full text-left p-2 hover:bg-gray-100"
                      onClick={() => handleRecordingSelect(recording)}
                    >
                      {recording.date} - {recording.time} ({recording.duration})
                    </button>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
        <div className="mb-4">
          <h2 className="text-lg font-bold mb-2">Case Transcript</h2>
          {/* Display case transcript here */}
        </div>
        <div className="mb-4">
          <h2 className="text-lg font-bold mb-2">Settings</h2>
        </div>
        <button className="bg-gray-300 text-gray-700 px-4 py-2 rounded-md">
          Logout
        </button>
      </div>
      <div className="w-3/4 p-4">
        <div className="flex items-center justify-between mb-4">
          <div className="flex items-center">
            <svg
              className="w-6 h-6 mr-2"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"
              />
            </svg>
            <input
              type="text"
              className="border rounded-md px-3 py-2"
              placeholder="Search"
            />
          </div>
          <div className="flex items-center">
            < svg
              className="w-6 h-6 mr-2"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M15 12a3 3 0 11-6 0 3 3 0 016 0z"
              />
            </svg>
            <input
              type="text"
              className="border rounded-md px-3 py-2"
              value={caseID}
              onChange={handleCaseIDChange}
              placeholder="Case ID"
            />
          </div>
        </div>
        {selectedRecording && (
          <div>
            <h2 className="text-lg font-bold mb-2">
              Recording: {selectedRecording.date} - {selectedRecording.time} (
              {selectedRecording.duration})
            </h2>
            {/* Display recording content here */}
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
